import React from 'react'
import { ReactDOM } from 'react';
import { render } from 'react-dom';


const TestData = {
        "id": 1,
        "testName": "Are you seek?",
        "description": "Yes",
        "questions": [
        {
            "id": 1,
            "question": "Why are you worked there",
            "subanswers": [
                {
                    "id": 1,
                    "answer": "This is me",
                    "score": 99
                }
            ]
        },
        {
            "id": 4,
            "question": "Is not a quest",
            "subanswers": []
        },
        {
            "id": 3,
            "question": "Is a quest",
            "subanswers": []
        }
    ]
}


let questions =[];

let TestName;
let TestDesc;
const TestObject = Object.entries(TestData);

TestObject.forEach(([key, value]) => {
    if(key == "testName"){
        TestName = value;
    }
    if(key == "description"){
        TestDesc = value;
    }
    if(key == "questions"){
        let numquest = 0;
        const TestQuestion = Object.entries(value[numquest]);
        TestQuestion.forEach(([key2, value2]) => {
            //salert(value2);
            if(key2 == "question"){
                questions.push(value2);
                questions[numquest][0] = value2;                
            }
        });
        numquest++;

    }
    
});

alert(questions);



const Item = (
    <div>
    </div>
);



export const TestReady = () => {
    return (
      <div className='Content'>
        <div className="Create">
            <div className="CreateHeader">
                <h1>Составь вопросы</h1>
                <div className="MainCreate">
                    <img src={'./img/createtest.jpg'} alt="" className='CreateImg'/>
                    <div className="CreateQuestions">
                        <form>
                            <p>Название</p>
                            <div className="QuestMessage">{TestName}</div>
                            <p>Описание</p>
                            <div className="QuestMessage">{TestDesc}</div>
                        </form>
                    </div>
                    <div>
                        
                    </div>
                </div>
            </div>
        </div>
      </div>
    )
    
  }
